(function () {
    var phone_title = 'Only numbers [long_s1] to [long_s2] characters long are allowed.';

    $(document).ready(function () {
        phoneCode();
        $('#open-account-form').find('[name="country_code"]').on('select2:select', function (e) {
            phoneCode();
        });

        $('.promo-select2').find('select').select2({
            templateResult: formatState,
            templateSelection: formatState
        });
    });

    function formatState(state) {
        if (!state.id) { return state.text; }
        var stateline = $('<span class="promo-flag f32 NOFLAG ' + state.title + '"></span> <span class="promo-flag">' + state.text + '</span>');
        return stateline;
    }

    function phoneCode() {
        let mincount = 9,
            maxcount = 15;

        $('#open-account-form').each(function () {
            var country_code = $(this).find('[name="country_code"] :selected'),
                code = country_code.data("code"),
                lengthcode = code.length - 1,
                phone = $(this).find('[name="mobile"]'),
                minlength = mincount - lengthcode,
                maxlength = maxcount - lengthcode;

            phone.attr('pattern', '[0-9]{' + minlength + ',' + maxlength + '}')
                .attr('minlength', minlength)
                .attr('maxlength', maxlength)
                .attr('title', phone_title.replace('[long_s1]', minlength).replace('[long_s2]', maxlength));
        });
    }
})();


jQuery(document).ready(function () {

    function stepper(id) {
        let delay = 3000;
        let fadeOut = 500;
        let fadeIn = 500;
        let timerId;

        const $Stepper = jQuery('[data-stepper="' + id + '"]');

        if ($Stepper.length) {

            $Stepper.find('.stepper-one').hide();
            $Stepper.find('.stepper-one:first-child').fadeIn(fadeIn);

            $Stepper.find('[data-to-step]').click(function (e) {
                e.preventDefault();

                var step = jQuery(this).data('to-step');

                $Stepper.find('.stepper-one.active').fadeOut(fadeOut, () => {
                    $Stepper.find('.stepper-one.active').removeClass('active');
                    $Stepper.find('[data-step="' + step + '"]').addClass('active');
                    $Stepper.find('.stepper-one.active').fadeIn(fadeIn);
                });

                clearInterval(timerId);
                timerId = setInterval(autoSlide, delay);

            });

            function autoSlide() {
                if ($(window).innerWidth() > 976) {

                    var active = Number($Stepper.children('.active').find('.section3_btn-active').html());
                    var step = active < 4 ? active + 1 : 1;
                    $Stepper.find('.stepper-one.active').fadeOut(fadeOut, () => {
                        $Stepper.find('.stepper-one.active').removeClass('active');
                        $Stepper.find('[data-step="' + step + '"]').addClass('active');
                        $Stepper.find('.stepper-one.active').fadeIn(fadeIn);
                    });

                }
            }

            timerId = setInterval(autoSlide, delay);

        }
    }

    stepper('some-name');

});
