    /*   Функция сериализации JS объекта, нужна для того чтобы отправить запрос, так как сервер блокирует запросы
          multipart/form-data, которые отправляются стандартными средствами
    */
    function serialize(obj, prefix) {
        let str = [],
            p;

        for (p in obj) {
            if (obj.hasOwnProperty(p)) {
                var k = prefix ? prefix + '[' + p + ']' : p,
                    v = obj[p];

                str.push((v !== null && typeof v === 'object') ?
                    serialize(v, k) :
                    encodeURIComponent(k) + '=' + encodeURIComponent(v));
            }
        }

        return str.join('&');
    }


    function addError(parentElement, text) {
        parentElement.querySelector('.invalid-feedback').innerHTML = '' + text + '';
        parentElement.querySelector('.form-control').classList.add('is-invalid');
    }

    let openAccountForm = document.getElementById('open-account-form');

